import Card from "react-bootstrap/Card";

const MovieItem = (props)=>{
    return(
        <Card>
            <Card.Header>{props.mymovie.Title}</Card.Header>
            <Card.Body>
            <img src={props.mymovie.Poster}></img>
            </Card.Body>
            <Card.Footer>{props.mymovie.Year}</Card.Footer>
        </Card>
    );

}

export default MovieItem;
